import React from "react";
const Footer = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col-12">
                    <div className="text-center pt-5 pb-3">
                        <p className=" text-light ">
                            All Rights Reserved! 2021
                        </p>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Footer;
